function getRandomAudioBase64() {
    var randomIndex = Math.floor(Math.random() * audioSounds.length);
    return "data:audio/mp3;base64," + audioSounds[randomIndex];
}

function convertDataURIToBinary(dataURI) {
    var BASE64_MARKER = ';base64,';
    var base64Index = dataURI.indexOf(BASE64_MARKER) + BASE64_MARKER.length;
    var base64 = dataURI.substring(base64Index);
    var raw = window.atob(base64);
    var rawLength = raw.length;
    var array = new Uint8Array(new ArrayBuffer(rawLength));

    for (i = 0; i < rawLength; i++) {
        array[i] = raw.charCodeAt(i);
    }
    return array;
}


function randomBang() {
    var data = getRandomAudioBase64()
    var binary = convertDataURIToBinary(data);
    var blob = new Blob([binary], {type: 'audio/mp3'});
    var blobUrl = URL.createObjectURL(blob);
    $("#source").attr("src", blobUrl);
    $("#audio")[0].pause();
    $("#audio")[0].load(); //suspends and restores all audio element
    $("#audio")[0].oncanplaythrough = $("#audio")[0].play();
}